import React from 'react'
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Typography,
    Box,
    ListItemIcon
} from "@material-ui/core";
import{
    ArrowBack,
    AssignmentInd,
    Home,
    Apps,
    ContactMail
} from "@material-ui/icons";
import silasImage from '../images/Silas.jpg'
import { makeStyles } from '@material-ui/core/styles';

// CSS styles
const useStyle = makeStyles(theme=>({
    menuSilderContainer:{
        widht:250,
        background:"#511",
        height:"30rem",
    },
    avatar:{
        display:"block",
        margin:'0.5rem auto',
        width:theme.spacing(30),
        height:theme.spacing(20),
    }
}));

const menuItems = [
    {
        listIcon: <Home/>,
        listText:"Home"
    },
    {
        listIcon: <AssignmentInd/>,
        listText:"Resume"
    },
    {
        listIcon: <Apps/>,
        listText:"Portfolio"
    },
    {
        listIcon: <ContactMail/>,
        listText:"Contacts"
    }
]

export const Navbar = () => {
    const classes = useStyle()
    return (
    <>
        <Box className={classes.menuSilderContainer} compoent = "div">
        {/* the avatart is the component for showing  a image */}
            <Avatar className={classes.avatar} src = {silasImage} alt="this is the photo of Silas" />
            <Divider/>
            <List>
                {menuItems.map((listItem,key)=> (      
                   <ListItem button key = {key}>
                       <ListItemIcon>{listItem.listIcon}</ListItemIcon>
                       <listText>{listItem.listText}</listText>
                   </ListItem>
                ))}
            </List>
        </Box>

        <Box component="nav">
            <AppBar position="static" style={{background:'#222'}}>
                <Toolbar>
                    <IconButton>
                        <ArrowBack style={{color:"tomato"}}/>
                    </IconButton>
                    <Typography variant='h5' style={{color:"tan"}}>
                        Porfolio
                    </Typography>
                </Toolbar>
            </AppBar>
        </Box>
    </>
    )
}

export default Navbar;
